import { Layout, Menu, Breadcrumb, Row, Col } from "antd";
import "./Profile.css";
import Icon, { MenuOutlined, CaretDownOutlined } from "@ant-design/icons";

const { SubMenu } = Menu;
const { Header, Content, Sider } = Layout;

const UserSvg = () => (
  <svg viewBox="0 0 512 512">
    <g>
      <g>
        <path d="M256,0c-74.439,0-135,60.561-135,135s60.561,135,135,135s135-60.561,135-135S330.439,0,256,0z" />
      </g>
    </g>
    <g>
      <g>
        <path
          d="M423.966,358.195C387.006,320.667,338.009,300,286,300h-60c-52.008,0-101.006,20.667-137.966,58.195
			C51.255,395.539,31,444.833,31,497c0,8.284,6.716,15,15,15h420c8.284,0,15-6.716,15-15
			C481,444.833,460.745,395.539,423.966,358.195z"
        />
      </g>
    </g>
  </svg>
);

const Sidebar = () => {
  return (
    <div>
      <Row>
        <Col flex="45px">
          <img
            src="https://salt.tikicdn.com/desktop/img/avatar.png"
            alt=""
            style={{ width: 45, borderRadius: 50 }}
          />
        </Col>
        <Col flex="150px">
          <div>Tài khoản của Trần Khánh Gia Uy</div>
        </Col>
      </Row>

      <Menu
        mode="inline"
        defaultSelectedKeys={["1"]}
        style={{ height: "100%", borderRight: 0 }}
      >
        <Menu.Item key="1">Thông tin tài khoản</Menu.Item>
        <Menu.Item key="2">Quản lý đơn hàng</Menu.Item>
        <Menu.Item key="3">option3</Menu.Item>
        <Menu.Item key="4">option4</Menu.Item>
      </Menu>
    </div>
  );
};

export default Sidebar;
